import { Route, Routes } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";


const App = ()=>{
  return(
    <>
      {/* <About/>
      <Contact/> */}
      <Routes> 
        <Route path="/about" element = {<About/>} />
        <Route path="/about" element = {<About/>} />
        <Route path="/" element = {<Contact/>} />
      </Routes>
    </>  
  )
}
export default App;
